const roomCart=document.querySelectorAll(".price-room__room");for(let o=0;o<roomCart.length;o++){var buttonCart=roomCart[o].querySelector(".price-room__book-button");null!==buttonCart&&buttonCart.addEventListener("click",(function(){roomCart[o].addEventListener("mouseleave",(function r(){roomCart[o].classList.add("price-room__room--book"),roomCart[o].removeEventListener("mouseleave",r)}))}))}for(let o=0;o<roomCart.length;o++)roomCart[o].addEventListener("click",(function(r){roomCart[o].classList.remove("price-room__room--book")}));